import React from 'react';
import { StyleSheet, View,Text, Button, useWindowDimensions, SafeAreaView} from 'react-native';
import { TabView, SceneMap, TabBar } from 'react-native-tab-view';
import { StatusBar } from 'expo-status-bar';


const renderTabBar = props => (
    <TabBar
      {...props}
      indicatorStyle={{ backgroundColor: '#008080' }}
      style={{ backgroundColor: 'white', shadowColor: 'silver',}}
      labelStyle={{ color: '#008080', fontSize: 12, fontWeight: 'bold'}}

    />
  );

export default function Events() {
  const layout = useWindowDimensions();

  const renderScene = SceneMap({
    first: () => (
      <View style={{ flex: 1, backgroundColor: 'white', justifyContent: 'center', alignItems: 'center' }}>
        <Text >This is the First View {'\n'}</Text>
        <Button title="Press Me" onPress={() => alert('Button Pressed!')} />
      </View>
    ),
    second: () => (
      <View style={{ flex: 1, backgroundColor: 'white', justifyContent: 'center', alignItems: 'center' }}>
        <Text>This is the Second View</Text>
        <View style={{flexDirection: 'row', alignItems: 'center'}}>
            <View style={{flex: 1, height: 1, backgroundColor: 'black', marginLeft: 20}} />
            <View>
                <Text style={{width: 50, textAlign: 'center'}}>Hello</Text>
            </View>
            <View style={{flex: 1, height: 1, backgroundColor: 'black', marginRight: 20}} />
        </View>
      </View>
    ),
  });


  const [index, setIndex] = React.useState(0);
  const [routes] = React.useState([
    { key: 'first', title: 'Upcoming Events' },
    { key: 'second', title: 'Past Events' },
  ]);

  return (
    <SafeAreaView style={styles.container}>

      <StatusBar style="auto" />

        {/* <View
            style={{
                borderBottomColor: 'black',
                borderBottomWidth: StyleSheet.hairlineWidth,
            }}
        /> */}
        <TabView
            renderTabBar={renderTabBar}
            navigationState={{ index, routes }}
            renderScene={renderScene}
            onIndexChange={setIndex}
            initialLayout={{ width: layout.width}}
        />
    </SafeAreaView>

  );
}


const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'cstart',
        justifyContent: 'center',
    },

  });
